Here is our solution to fix the problem 

   run : function()
    {
      // Code is needed to startup the application as we use closure parts. That's why we 
      // had to move the code from the qx.$$loader code to the bootstrap of the application:
      // - normally qx.$$loader calls qx.event.handler.Application.onScriptLoaded(), so we have to do it here. 
      // - qx.core.Init.ready(); has to be called to prevent the case that the "ready" event is fired before the 
      //   Application class is available.
      // Opened a bug in qooxdoo so that this code can be moved to qooxdoo again.

      // added onScriptLoaded call to fix raise condition in IE source version.
      // Make shure that the Application is ready.
      qx.event.handler.Application.onScriptLoaded();

      // Sometimes it can happen that the application is ready, but the Application class was not available yet.
      // That is why we have to make shure that qx.core.Init.ready starts the application.
      var handler = qx.event.Registration.getManager(window).getHandler(qx.event.handler.Application);
      if (handler.isApplicationReady()) {
        qx.core.Init.ready();
      }
    },
